import React, { useEffect, useRef } from 'react';
import './Contact.css'; // Assuming you have a CSS file for styles

const Contact = () => {
  const vismeRef = useRef(null);

  useEffect(() => {
    if (vismeRef.current) {
      const div = document.createElement('div');
      div.className = 'visme_d';
      div.setAttribute('data-title', 'Untitled Project');
      div.setAttribute('data-url', 'z41gx3rv-untitled-project');
      div.setAttribute('data-domain', 'forms');
      div.setAttribute('data-full-page', 'false');
      div.setAttribute('data-min-height', '500px');
      div.setAttribute('data-form-id', '83022');
      vismeRef.current.appendChild(div);

      const script = document.createElement('script');
      script.src = 'https://static-bundles.visme.co/forms/vismeforms-embed.js';
      document.body.appendChild(script);
    }
  }, []);

  return (
    <div className="contact-container">
      <div ref={vismeRef}></div>
    </div>
  );
};

export default Contact;
